Two right triangles share a side as follows: [asy]
pair pA, pB, pC, pD, pE;
pA = (0, 0);
pB = pA + 4 * dir(0);
pC = pA + 5 * dir(90);
pD = pB + 4 * dir(90);
pE = (4 * pA + 5 * pD) / 9;
draw(pA--pB--pC--pA);
draw(pA--pB--pD--pA);
label("$A$", pA, SW);
label("$B$", pB, SE);
label("$C$", pC, NW);
label("$D$", pD, NE);
label("$E$", pE, 2 * N);
label("$4$", pA--pB, S);
label("$5$", pA--pC, W);
label("$4$", pB--pD, E);
draw(rightanglemark(pB,pA,pC,8));
draw(rightanglemark(pD,pB,pA,8));
[/asy] What is the area of $\triangle ABE$?

